const TemplateAdmin = () => {
    return (


       
              
            <div className="Result" >
            <h1 align="center">Archive de document</h1>
            <div className="ms-3" col="11">
                <div className="row">
                  
                   <Navigation/>


                    <div className=" col-10">
                        
                    <Outlet/>

                    </div>
                </div>
                </div>
             </div>

   
      
      
    );
};

export default TemplateAdmin;
